std::vector<SegmentID> Draw( const std::vector<drawable::Drawable<DrawableWhereT>>& drawables, u_int32_t width, u_int32_t height) { std::vector<SegmentID> img_seg_ids; img_seg_ids.reserve(width * height); // CAREFUL: DO NOT switch the order else the final garbled outputs will be // rotated 90 degrees. Not a catastrophe but not ideal. for (uint32_t y = 0; y < height; ++y) { for (uint32_t x = 0; x < width; ++x) { drawable::Point2DRelative rel_coords_world( static_cast<float>(x) / static_cast<float>(width), static_cast<float>(y) / static_cast<float>(height)); // Find a drawable, if the rel_coords(ie the current pixel) is indeed on // one else it means it is background bool is_background = true; uint32_t offset_nb_segments = 0; for (const auto& drawable : drawables) { if (drawable.Where().IsInBBox(rel_coords_world)) { is_background = false; auto rel_coords_local = drawable.Where().GetRelCoordsLocalFromRelCoordsWorld( rel_coords_world); auto local_seg_id = drawable.What().GetSegmentID(rel_coords_local); if (local_seg_id != -1) { // REALLY IMPORTANT // MUST convert the local_seg_id(eg usually 0-6 for 7 segs) // to a global one UNIQUE in the final bitmap img_seg_ids.emplace_back( SegmentID(offset_nb_segments + local_seg_id)); } else { // background (in the current drawable) img_seg_ids.emplace_back(-1); } // we COULD overwrite with another Drawable in case of overlap but // what is the point; we might as well stop processing break; } offset_nb_segments += drawable.What().GetNbSegments(); } // background (in the global bitmap) if (is_background) { img_seg_ids.emplace_back(-1); } } } assert(img_seg_ids.size() == width * height && "Draw: missing pixels!"); return img_seg_ids;
