std::string Segments2Pixels<DrawableWhereT>::GenerateVerilog() const { // Generate the complete bitmap, then compute the SegmentID for each pixel // Previously it was done is the ctor then stored in class member but it is // only used here so no point in doing that std::vector<drawable::SegmentID> bitmap_seg_ids = Draw(drawables_, width_, height_); std::vector<utils::RLE_int8_t> bitmap_seg_ids_rle = utils::compress_rle(bitmap_seg_ids); std::string verilog_buf; unsigned int nb_inputs = nb_segments_ - 1, nb_outputs = (width_ * height_) - 1; // without reserve : 1657472 - 1771623 (ns) // with reserve : 1250652 - 1356733 (ns) // Now in the .v, ranges are encoded as eg: assign p[75295:75287] = 0; // So we really do not need much memory. unsigned int nb_pixels = width_ * height_; size_t size_to_reserve = ((nb_pixels * strlen("assign p[000000] = s[0000];\n")) / 5) + 1000; verilog_buf.reserve(size_to_reserve); verilog_buf += "// module to convert segments into an image bitmap\n"; verilog_buf += "// generated by lib_circuits/src/segments2pixels/segments2pixels.cpp\n"; verilog_buf += "// (c) Interstellar\n\n"; verilog_buf += "module segment2pixel(s, p); // convert segments to pixels\n"; // TODO verilog_buf += fmt::format("input [{:d}:0] s; // segments to display\n", nb_inputs); verilog_buf += fmt::format("output [{:d}:0] p; // pixels output\n", nb_outputs); // TODO use absl or fmtlib size_t pixels_counter = 0; for (const auto& it : bitmap_seg_ids_rle) { // NOTE: bitmap_seg_ids_rle is RLE encoded // - OFF segment(seg_id==-1): "assign p[7680:0] = 0;" // - ON segment(eg seg_id=16): "assign p[17855:17854] = s[16];" auto seg_id = it.value; auto len = it.size; if (seg_id == -1) { // NOTE: range inverted! written as eg [7680:0] not [0:7680] verilog_buf += "assign p["; verilog_buf += fmt::format_int(pixels_counter + len - 1).str(); verilog_buf += ":"; verilog_buf += fmt::format_int(pixels_counter).str(); verilog_buf += "] = "; verilog_buf += "0;\n"; } else { // When a valid seg_id, we CAN NOT write eg "assign p[7456:7412] = s[14];" // This is NOT valid verilog, apparently // verilator --lint-only: "Operator ASSIGNW expects 47 bits on the Assign // RHS, but Assign RHS's SEL generates 1 bits." for (uint32_t j = pixels_counter; j < pixels_counter + len; ++j) { verilog_buf += "assign p["; verilog_buf += fmt::format_int(j).str(); verilog_buf += "] = "; verilog_buf += "s["; verilog_buf += fmt::format_int(seg_id).str(); verilog_buf += "];\n"; } } pixels_counter += len; } verilog_buf += "endmodule"; return verilog_buf;
